import React, {Component} from 'react';

class Section extends Component {
    render() {
        return (
            <>
                    <section>
                        <hr/>

                        <h2>projects I have done :</h2>

                        <div className="card1">
                            <div className="frame">
                                <h3>maxway Site</h3>
                            </div>
                        </div>
                    </section>
            </>
        );
    }
}

export default Section;
